/*
 * Examples
 * (To see them, uncomment and save)
 */
atom-text-editor::shadow .bracket-matcher .region {
  border: 1px solid rgba(222, 149, 54, 0.6);
  border-radius: 3px;
  background-color: rgba(255, 217, 0, 0.3);
  z-index: 100;
}
atom-text-editor::shadow .invisible-character {
  color: transparent;
}
atom-text-editor::shadow .invisible-character.trailing-whitespace {
  color: rgba(255, 255, 255, 0.2);
}
atom-text-editor::shadow .invisible-character.hard-tab {
  position: relative;
  color: transparent;
}
atom-text-editor::shadow .invisible-character.hard-tab:before {
  position: absolute;
  top: 50%;
  left: 1px;
  right: 1px;
  content: "";
  border-bottom: 1px solid rgba(255, 255, 255, 0.2);
}
atom-text-editor {
  text-rendering: optimizeLegibility;
}
